import React from "react";
import { Link } from "react-router-dom";

export const Closed_Toggler_Button = () => {

        const Url = URLSearchParams(document.location.search)
        const Openfilter_Url = Url.set('FilterTab','opened')

        return <React.Fragment>

        <Link to={Openfilter_Url}>
        <span id='Closed_Toggler_Button'>
        Open Filter 
        </span>
        </Link>

        </React.Fragment>

}

export default Closed_Toggler_Button;
